class ActionsResponseModel {
  int _id;
  int _meetingId;
  int _creatorId;
  String _title;
  String _openTill;
  String _priority;
  String _description;
  int _order;
  List<ActionComments> _comments;
  List<Participants> _participants;
  List<ActionsResponseModelAttachments> _attachments;

  int get id => _id;
  int get meetingId => _meetingId;
  int get creatorId => _creatorId;
  String get title => _title;
  String get openTill => _openTill;
  String get priority => _priority;
  String get description => _description;
  int get order => _order;
  List<ActionComments> get comments => _comments;
  List<Participants> get participants => _participants;
  List<ActionsResponseModelAttachments> get attachments => _attachments;

  ActionsResponseModel({
      int id, 
      int meetingId, 
      int creatorId, 
      String title, 
      String openTill, 
      String priority, 
      String description, 
      int order, 
      List<ActionComments> comments,
      List<Participants> participants, 
      List<ActionsResponseModelAttachments> attachments}){
    _id = id;
    _meetingId = meetingId;
    _creatorId = creatorId;
    _title = title;
    _openTill = openTill;
    _priority = priority;
    _description = description;
    _order = order;
    _comments = comments;
    _participants = participants;
    _attachments = attachments;
}

  ActionsResponseModel.fromJson(dynamic json) {
    _id = json['id'];
    _meetingId = json['meeting_id'];
    _creatorId = json['creator_id'];
    _title = json['title'];
    _openTill = json['open_till'];
    _priority = json['priority'];
    _description = json['description'];
    _order = json['order'];
    if (json['comments'] != null) {
      _comments = [];
      json['comments'].forEach((v) {
        _comments.add(ActionComments.fromJson(v));
      });
    }
    if (json['participants'] != null) {
      _participants = [];
      json['participants'].forEach((v) {
        _participants.add(Participants.fromJson(v));
      });
    }
    if (json['attachments'] != null) {
      _attachments = [];
      json['attachments'].forEach((v) {
        _attachments.add(ActionsResponseModelAttachments.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    map['id'] = _id;
    map['meeting_id'] = _meetingId;
    map['creator_id'] = _creatorId;
    map['title'] = _title;
    map['open_till'] = _openTill;
    map['priority'] = _priority;
    map['description'] = _description;
    map['order'] = _order;
    if (_comments != null) {
      map['comments'] = _comments.map((v) => v.toJson()).toList();
    }
    if (_participants != null) {
      map['participants'] = _participants.map((v) => v.toJson()).toList();
    }
    if (_attachments != null) {
      map['attachments'] = _attachments.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

